OpenLayers.Lang.sk=OpenLayers.Util.applyDefaults({unhandledRequest:"Neobslúžené požiadavky vracajú ${statusText}",Permalink:"Trvalý odkaz",Overlays:"Prekrytia","Base Layer":"Základná vrstva",readNotImplemented:"Čítanie nie je implementované.",writeNotImplemented:"Zápis nie je implementovaný.",noFID:"Nie je možné aktualizovať vlastnosť, pre ktorú neexistuje FID.",errorLoadingGML:"Chyba pri načítaní súboru GML ${url}",browserNotSupported:"Váš prehliadač nepodporuje vykresľovanie vektorov. Momentálne podporované vykresľovače sú:\n${renderers}",componentShouldBe:"addFeatures: komponent by mal byť ${geomType}",getFeatureError:"getFeatureFromEvent bola zavolaná na vrstve bez vykresľovača. To zvyčajne znamená, že ste odstránili vrstvu, ale nie niektorú z obslúh, ktorá je s ňou asociovaná.",minZoomLevelError:"Vlastnosť minZoomLevel je určený iba na použitie s vrstvami odvodenými od FixedZoomLevels. To, že táto wfs vrstva kontroluje minZoomLevel je pozostatok z minulosti. Nemôžeme ho však odstrániť, aby sme sa vyhli možnému porušeniu aplikácií založených na Open Layers, ktoré na tomto môže závisieť. Preto ho označujeme ako zavrhovaný - dolu uvedená kontrola minZoomLevel bude odstránená vo verzii 3.0. Použite prosím namiesto toho kontrolu min./max. rozlíšenia podľa tu uvedeného popisu: http://trac.openlayers.org/wiki/SettingZoomLevels",commitSuccess:"Transakcia WFS: ÚSPEŠNÁ ${response}",commitFailed:"Transakcia WFS: ZLYHALA ${response}",googleWarning:"Vrstvu Google nebolo možné správne načítať.<br><br>Aby ste sa tejto správy zbavili vyberte novú BaseLayer v prepínači vrstiev v pravom hornom rohu.<br><br>Toto sa stalo pravdepodobne preto, že skript knižnice Google Maps buď nebol načítaný alebo neobsahuje správny kľúč API pre vašu lokalitu.<br><br>Vývojári: Tu môžete získať <a href='http://trac.openlayers.org/wiki/Google' target='_blank'>pomoc so sfunkčnením</a>",getLayerWarning:"Vrstvu ${layerType} nebolo možné správne načítať.<br><br>Aby ste sa tejto správy zbavili vyberte novú BaseLayer v prepínači vrstiev v pravom hornom rohu.<br><br>Toto sa stalo pravdepodobne preto, že skript knižnice ${layerType} buď nebol načítaný alebo neobsahuje správny kľúč API pre vašu lokalitu.<br><br>Vývojári: Tu môžete získať <a href='http://trac.openlayers.org/wiki/${layerType}' target='_blank'>pomoc so sfunkčnením</a>","Scale = 1 : ${scaleDenom}":"Mierka = 1 : ${scaleDenom}",layerAlreadyAdded:"Pokúsili ste sa do mapy pridať vrstvu ${layerName}, ale tá už bola pridaná",reprojectDeprecated:"Používate voľby „reproject“ vrstvy ${layerType}. Táto voľba je zzavrhovaná: jej použitie bolo navrhnuté na podporu zobrazovania údajov nad komerčnými základovými mapami, ale túto funkcionalitu je teraz možné dosiahnuť pomocou Spherical Mercator. Ďalšie informácie získate na stránke http://trac.openlayers.org/wiki/SphericalMercator.",methodDeprecated:"Táto metóda je zavrhovaná a bude odstránená vo verzii 3.0. Použite prosím namiesto nej metódu ${newMethod}.",boundsAddError:"Sčítacej funkcii musíte dať hodnoty x aj y.",lonlatAddError:"Sčítacej funkcii musíte dať hodnoty lon (zem. dĺžka) aj lat (zem. šírka).",pixelAddError:"Sčítacej funkcii musíte dať hodnoty x aj y.",unsupportedGeometryType:"Nepodporovaný typ geometrie: ${geomType}",filterEvaluateNotImplemented:"evaluate nie je implementovaný pre tento typ filtra"});